INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1545', 'This geocache can be found at night only - it is a so-called night cache. There may be reflectors which have to be flashlighted and will point to the hiding place, or other special night-caching mechanisms.', '2010-09-12 22:52:28');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1546', 'This geocache is listed at Opencaching only. This attribute will enable users of other geocaching platforms to find interesting OC caches quickly.', '2010-09-12 22:52:28');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1547', 'This cache ist listed at Opencaching and at other geocaching sites. This applies to caches which have been linked by their owners to the corresponding listings at other sites. Please note that descriptions and status of multiple-listed caches have to be equally maintained at all sites including Opencaching, according to our terms of use.', '2010-09-12 22:52:28');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1548', 'There is a stamp in the cache for stamping your personal logbook, and the cache’s logbook will be stamped with your personal stamp. Take care not to mix up stamps and to leave the cache’s stamp in the cache! Frequently letterboxes can be found without GPS, maybe with a compass and paces from a location - add the \"without GPS\" attribute for those.', '2010-09-12 22:52:28');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1549', 'The cache is located within a dangerous area. Use this attribute to mark non-obvious dangers, like high-traffic roads, steep ground or falling rocks. Security measures should be taken or the cache be omitted, especially when geocaching with children, large groups or at unfavourable weather conditions.', '2010-09-12 22:52:28');
