INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1599', 'There are active railroads nearby. Please be careful, keep a safe distance and cross the rails only at level crossings etc.!', '2010-09-12 23:11:48');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1600', 'There are cliffs or dangerous rocks nearby. Beware of falling rocks at the lower side, and be careful at the upper side of cliffs - especially with children and while mountain biking. It can be very dangerous to take a steep slope towards a cliff, because you may not notice in time where the former ends and the latter starts.', '2010-09-12 23:11:48');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1601', 'The geocache is placed within a hunting ground. At twilight and in the dark, a flashlight or headlight should always be used for security reasons. Be considerate when meeting hunters.', '2010-09-12 23:11:48');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1602', 'There are thorns near the cache. Wear appropriate clothes.', '2010-09-12 23:11:48');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1603', 'There are seasonably many ticks in this area. It is recommended to wear long trousers and to check yourself for ticks after geocaching. There are risk maps for tick-borne encephalitis in the internet, e.g. for Germany at sites like www.meningitis.de (look for FSME there).', '2010-09-12 23:11:48');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1604', 'In the water', '2010-09-12 23:18:21');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1605', 'This cache can be done both at daylight and at night.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1606', 'This cache can only be done at certain times of day - see the cache description for more details. For example, the cache may be placed in an area with restricted opening hours.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1607', 'This cache shoud be attempted during daylight only. For example, the area may be dangerous and contain cliffs or abysses. Or using flashlights may be unfeasable because it would look suspicious within a residential area.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1608', 'This cache can be done only at low-tide or only at high-tide.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1609', 'This cache can be found the whole year round, while difficulty may depend on seasons. Specify difficulty for good conditions.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1610', 'Don’t seek this cache during animal breeding season! Please indicate in the cache description which time of year must be avoided. Also, pay attention to the local terms and signs regarding nature protection.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1611', 'This cache can be found even after heavy snowing. All stages and the geocache are hidden in a snow-safe way: they will not be covered by fallen snow an not by snow-piles created by snow-clearing vehicles.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1612', 'You will need special equipment which is not specified by other attributes, e.g. a laser pointer, walkie-talkies or a car jack.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1613', 'A compass is required.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1614', 'A flashlight is required for finding this cache. Don’t forget spare batteries!', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1615', 'For this cache, you will need climbing equipment and the knowledge how to use it properly. If you are a beginner, don’t do it alone but use the support of a experienced climber or mountaineer.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1616', 'This geocache is hidden in a cave, and you should use appropriate equipment to access it. Beware: Even small caves may confront you with unforeseen problems and dangers, like thunder storms (water!) or a sprained ankle. Have advice first from cave-experienced people! Also take care of protected nature; e.g. bat places must not be disturbed.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1617', 'You will need diving equipment to find this geocache. The water depth of the cache location is specified in the description. Please note that secure diving requires special training. Without diving experience, you may search this cache in company of a diving teacher.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1618', 'This cache usually can be found only using a watercraft. Swimming is impossible because of the distance or currents. See the cache description for more details.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1619', 'You must investigate additional information before you can seek this cache. This commonly applies to puzzle/mystery caches.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1620', 'Puzzles or mysteries have to be solved before or while seeking this cache.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1621', 'Before or while seeking this cache, arithmetical problems must be solved which go beyond very basic calculations.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1622', 'This is none of the standard, pre-defined types of cache. Use this attribute for special, unusual caches.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1623', 'Before doing this cache, you must ask the owner for the starting conditions. E.g. the cache may be linked to certain events at varying dates.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1624', 'This geocache is created for children. All challenges can be solved by child in the age of 10 to 12 years and the terrain has no risks (like highways, abysms). There is a large geocache container with trading items inside and the challenges are interesting.', '2010-09-12 23:27:38');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1625', 'This cache leads into a (former) mining area. There may be dangers by collapsing adits, or you may need to enter adits. Be careful and use appropriate equipment, especially in the dark. Old mines may be covered by historic preservation.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1626', 'There are poisonous plants near the cache. Take care and prevent children and dogs from touching or eating them.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1627', 'The area is inhabited by possibly dangerous animals, e.g. rabies areas, venomous snakes, scorpions or bears.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1628', 'A nearby parking area is situated as starting point for doing this cache. If no free parking is available, add the \"access or parking fee\" attribute.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1629', 'This cache is located outside of urban areas and has a public transport station nearby. Don’t set this attribute for geocaches in urban areas that are commonly equipped with public transportation.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1630', 'There is drinking water along the trail or near the cache. This attribute is useful especially for planning event caches, longer hikes or caches at probably dirty locations like caves.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1631', 'There are public restrooms along the way or near the cache. This attribute is useful especially for planning event caches or extensive multicaches.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1632', 'There is a public phone along the way or near the cache. Especially for event caches you should enquire for nearby phones and set this attribute if applicable.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1633', 'There is a first aid station, call box, mountain rescue or similar arrangement near the cache. This attribute is useful especially in demanding areas, like climbing caches, cave caches, high mountains or at the water. Check if you can add emergency phone numbers (like a mountain rescue) to your cache listing.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1634', 'The geocache is located close to a parking area, only a few steps away - it’s a \"cache and dash\".', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1635', 'This cache requires a long walk - more than 5 km round trip. In the mountains and other steep areas, the distance for a \"long walk\" may be shorter. Walking shoes and appropriate equipment are recommended.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1636', 'This cache requires passing swampy or marshy ground. Wear appropriate clothes. After rainfall, the terrain may be very demanding or not passable at all.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1637', 'One or more ascents lie between you and the cache.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1638', 'This cache requires some climbing and you may have to use your hands, but you won’t need climbing gear. Be very careful during rainy weather or before thunderstorms!', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1639', 'This cache requires crossing a river or a lake. The water is steep ', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1640', 'There is a point of interest at the cache, like a nice scenic overlook or a larger castle ruin. This place is worth visiting it even without a geocache nearby.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1641', 'This geocache is moving around. For example, the owner might regularly move the cache from one place to another, or the finders will do this task and post new coordinates in their log entries. The owner must update coordinates in the cache description after each move.', '2010-09-12 23:39:51');
INSERT INTO `sys_trans` (`id`, `text`, `last_modified`) VALUES ('1642', 'There is a webcam at the target location. You must record a webcam picture of your visit and include it in your \"found\" log entry. There may be additional requirements like a geocaching banner on the photo. The webcam’s address is included in the cache description, and it must be publicly accessible, i.e. no user account or similar is required.', '2010-09-12 23:39:51');
