INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('837', 'DE', 'Ja, ich habe obige Bedingungen gelesen, verstanden und bin damit einverstanden.', '2010-08-28 11:48:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('838', 'DE', 'Wenn du einen Benutzer gefunden hast, der deinen Geocache adoptieren möchte, trage bitte unten den Benutzername ein und bestätige den Vorgang. Der Benutzer wird diesen Geocache dann unter Mein Profil \&gt; Adoptionen. Um die Adoption abzuschließen muss der Benutzer die Nutzungsbedingungen von Opencaching.de akzeptieren und die Adoption bestätigen. Du kannst einen Geocache mehreren Benutzern zur Adoption anbieten. Der erste Benutzer, der die Adoption bestätigt, wird der neue Besitzer des Geocaches. Mit der Adoption gibst du dem Benutzer ein unbeschränktes Recht urheberrechlich geschützte Inhalte dieses Geocaches zu nutzen, modifizieren und weiter zu geben.', '2010-08-28 11:48:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('839', 'DE', '%1 zur Adoption anbieten', '2010-08-28 11:48:07');
