INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('465', 'ES', '¿Sabes algunas noticias de interés sobre Geocaching?<br /> Aquí puedes crear una entrada de noticias que se mostrarán en la página principal.', '2010-12-09 00:17:57');
