INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1537', 'ES', 'El código HTML será cambiado de nuevo por un filtro especial. Esto es necesario para evitar peligrosas las etiquetas HTML, como\&lt;script\&gt;. Una lista de etiquetas HTML permitidas la podra encontrar en <a href=\"http://www.opencaching.de/articles.php?page=htmltags\">qui</a>.', '2010-12-09 00:18:00');
