INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('81', 'IT', 'Che cosa trovo in questo sito?', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('82', 'IT', 'Caro visitatore,<br />\r\n<br />\r\nbenvenuto alla versione italiana di opencaching.de.\r\nAbbiamo creato queste pagine per renderti più facile utilizzare la\r\npiattaforma opencaching. Qui puoi trovare o registrare cache\r\nopencaching.de situate in tutto il mondo, anche se l\'obiettivo\r\nprimario sono le cache nella parte d\'Europa in  lingua tedesca.\r\nIn un secondo tempo contiamo di realizzare un sito che raccolga\r\nprincipalmente le cache per coloro che parlano italiano.\r\nAnche se oggi ci sono relativamente pochi utenti italiani che\r\nutilizzano opencaching.de, anche tu puoi contribuire  a diffondere\r\nl\'opencaching con i tuoi log e con la registrazione di cache nella tua\r\nlingua.<br />\r\n<br />\r\nPoiché opencaching.de è un progetto no profit gestito da volontari,\r\npurtroppo non siamo in condizione di manutenere una piattaforma di\r\ncaching a livello mondiale o fornire da soli pieno sostegno\r\ninternazionale agli utenti. Abbiamo bisogno del tuo aiuto per\r\ncostruire una rete opencaching. L\'idea è di avere diversi nodi\r\nopencaching per i diversi paesi in tutto il mondo con un database di\r\nutenti e di cache sincronizzato.\r\nSe hai qualsiasi domanda sull\'utilizzo della piattaforma opencaching,\r\nnon esitare a metterti in contatto con noi.<br />\r\n<br />\r\nAlcuni geocacher italiani hanno intenzione di gestire in proprio un\r\nnodo opencaching. Contattateci se desiderate maggiori informazioni su\r\ndi noi o se volete aiutarci con una donazione* oppure ospitando\r\ngratuitamente l\'hosting del sito.<br />\r\n<br />\r\nCordiali saluti,<br />\r\n<br />\r\nIl Team opencaching.de<br />\r\n<br />\r\n* se desiderate donare per il sito italiano di opencaching,\r\ncontattateci prima di inviare denaro; c\'e un account paypal separato\r\ncreato a questo scopo.', '2010-12-19 00:27:25');
