INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1590', 'IT', 'Attrezzatura per immersione', '2010-09-12 23:14:17');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1591', 'IT', 'Barca', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1592', 'IT', 'Elicottero', '2010-09-12 23:14:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1593', 'IT', 'Ricerca', '2010-09-12 23:13:56');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1594', 'IT', 'Puzzle / Mystery', '2010-09-12 23:13:45');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1595', 'IT', 'Problema matematico', '2010-09-12 23:13:41');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1596', 'IT', 'Altro tipo di cache', '2010-09-12 23:13:36');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1597', 'IT', 'Chiedere al proprietario per le condizioni di partenza', '2010-09-12 23:13:31');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1598', 'IT', 'Adatta ai bambini', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1599', 'IT', 'Ci sono ferrovie attive nelle vicinanze. Per favore usate cautela, tenendo una distanza di sicurezza e attraversando le rotaie solo ai passaggi a livello ecc.!', '2010-09-12 23:13:13');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1600', 'IT', 'Ci sono scogliere o rocce pericolose nelle vicinanze. Fate attenzione alla caduta pietre quando siete sotto, e siate cauti quando siete sopra la scogliera - specialmente con bambini e in bicicletta. Può essere molto pericoloso prendere un sentiero ripido per salire la scogliera, poiché non potete sapere in anticipo quando la prima termina e inizia l\'altra.', '2010-09-12 23:13:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1601', 'IT', 'La geocache è situata nei pressi di una area di caccia. Al crepuscolo e al buio, dovrebbe sempre essere usata una torcia portatile o frontale per ragioni di sicurezza. Incontrando i cacciatori è opportuna una reciproca gentilezza.', '2010-09-12 23:13:03');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1602', 'IT', 'Ci sono spine nei pressi della cache. Indossare indumenti appropriati.', '2010-09-12 23:12:57');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1603', 'IT', 'Stagionalmente ci sono molte zecche in questa area. E\' raccomandabile indossare pantaloni lunghi e ispezionarsi alla ricerca di zecche dopo il geocaching. In internet ci sono mappe di rischio per <i>encefalite e borelliosi da morso di zecca</i>, ad es. per la Germania si veda www.meningitis.de e si cerchi \"FSME\".', '2010-09-12 23:12:52');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1604', 'IT', 'Nell\'acqua', '2010-09-13 22:10:04');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1605', 'IT', 'Questa cache può essere trovata sia di giorno che di notte.', '2010-09-12 23:30:34');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1607', 'IT', 'Si dovrebbe cercare questa cache solamente durante il giorno. Ad esempio, l\'area può essere pericolosa e contenere scogliere o abissi. Oppure, l\'utilizzo di torce elettriche potrebbe essere impossibile perché risulterebbe sospetto all\'interno di una zona residenziale.', '2010-09-12 23:30:29');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1608', 'IT', 'Questa cache può essere cercata solo con bassa marea o solo con alta marea.', '2010-09-12 23:30:43');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1609', 'IT', 'Questa cache si trova tutto l\'anno, mentre la difficoltà può dipendere dalle stagioni. Specificare difficoltà per le <i>buone</i> condizioni.', '2010-09-12 23:30:47');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1610', 'IT', 'Non cercare questa cache durante il periodo riproduttivo degli animali! Per favore indicate nella descrizione della cache quale periodo dell\'anno debba essere evitato. Prestate anche attenzione alle condizioni o ai cartelli riguardo il rispetto della natura.', '2010-09-13 15:09:00');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1611', 'IT', 'Questa cache può essere trovata anche dopo forti nevicate. Tutte le fasi e la geocache sono nascosti in luoghi sicuri per la neve: non saranno coperti da neve caduta né da cumuli di neve creati ad esempio da veicoli spalaneve.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1612', 'IT', 'Avrete bisogno di attrezzature speciali non specificate da altri attributi, come ad esempio un puntatore laser, walkie-talkie o un cric.', '2010-09-12 23:30:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1613', 'IT', 'E\' necessaria una bussola.', '2010-09-12 23:29:32');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1614', 'IT', 'E\' necessaria una torcia portatile per trovare questa cache. Non dimenticate le batterie di riserva!', '2010-09-13 15:09:35');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1615', 'IT', 'Per questa cache, avrete bisogno di materiale da arrampicata e di saperlo usare correttamente. Se sei un principiante, non farlo da solo, ma utilizza il sostegno di uno scalatore esperto o un alpinista.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1616', 'IT', 'Questa geocache è nascosta in una grotta, e si dovrebbe utilizzare attrezzature adeguate per accedervi. Attenzione: anche piccole grotte possono prevedere problemi imprevisti e pericoli, come in caso di temporali (acqua!) o una caviglia slogata. Consigliatevi prima con persone che abbiano esperienza di grotte! Abbiate anche cura della natura protetta, ad esempio dei luoghi dove i pipistrelli non devono essere disturbati.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1617', 'IT', 'Avrete bisogno di attrezzatura subacquea per trovare questa geocache. La profondità d\'acqua nella posizione della cache viene specificata nella descrizione. Si prega di notare che l\'immersione in tutta sicurezza richiede una formazione specifica. Senza esperienza di immersioni, è possibile cercare questa cache in compagnia di un insegnante di sub.', '2010-09-12 23:29:52');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1618', 'IT', 'Questa cache di solito può essere trovata solo con una moto d\'acqua. Il nuoto è impossibile a causa della distanza o delle correnti. Vedi la descrizione della cache per maggiori dettagli.', '2010-09-12 23:29:27');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1619', 'IT', 'È necessario trovare ulteriori informazioni prima di poter cercare questa cache. Ciò si applica comunemente a puzzle o mystery cache.', '2010-09-12 23:29:18');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1620', 'IT', 'Puzzle o Mystery devono essere risolti prima o durante la ricerca di questa cache.', '2010-09-12 23:29:13');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1621', 'IT', 'Prima o durante la ricerca di questa cache, devono essere risolti problemi matematici più difficili di semplici calcoli base.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1622', 'IT', 'Questa è una cache che non appartiene a nessuna delle categorie standard perdefinite. Usa questo attributo per cache speciali e inusuali.', '2010-09-12 23:28:58');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1623', 'IT', 'Prima di cercare questa cache, è necessario chiedere al proprietario le condizioni di partenza. Ad esempio la cache può essere collegata ad alcuni eventi in date diverse.', '2010-09-12 23:28:53');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1624', 'IT', 'Questa geocache è stata creata per i bambini. Tutte i compiti possono essere portati a termine da bambini tra 10 e 12 anni e il terreno non presenta rischi (come autostrade, abissi). C\'e un grande contenitore finale con oggetti di scambio e i compiti sono interessanti.', '2010-09-13 22:10:04');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1625', 'IT', 'Questa cache vi porta in una area di miniera (abbandonata). Ci possono essere pericoli per crollo di gallerie, o potrebbe essere necessario attraversare gallerie. Fare attenzione e utilizzate attrezzature adeguate, soprattutto al buio. Le vecchie miniere possono essere oggetto di conservazione storica.', '2010-09-12 23:43:40');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1626', 'IT', 'Ci sono piante velenose nelle vicinanze. Fate attenzione e controllate che bambini o cani non le tocchino o le ingoino.', '2010-09-12 23:43:45');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1627', 'IT', 'Quest area è frequentata da animali potenzialmente pericolosi, ad es. volpi rabide, serpenti velenosi, scorpioni, orsi.', '2010-09-12 23:43:35');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1628', 'IT', 'Una area di parcheggio è situata nei pressi del punto di partenza di questa cache. Se non è disponibile un parcheggio gratuito, aggiungi l\'attributo \"Tassa di ingresso o di parcheggio\"', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1629', 'IT', 'Questa cache è situata al difuori di aree urbane e ha una stazione di trasporto pubblico nelle vicinanze. Non usate questo attributo per geocache in aree urbane che sono comunemente fornite di mezzi di trasporto pubblico.', '2010-09-13 15:07:05');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1630', 'IT', 'C\'è acqua potabile lungo il percorso o nelle vicinanze della cache. Questo attributo è utile soprattutto nella pianificazione di cache evento, di lunghe escursioni o di cache in luoghi probabilmente sporchi come le grotte o le miniere.', '2010-09-12 23:43:10');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1631', 'IT', 'Ci sono WC pubblici lungo la strada o nelle vicinanze della cache. Questo attributo è utile soprattutto per pianificare cache evento o lunghe multicache.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1632', 'IT', 'Ci sono telefoni pubblici lungo la strada o nelle vicinanze della cache. Specialmente per cache evento dovreste cercare telefoni nelle vicinanze e settare questo attributo se ce ne sono.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1633', 'IT', 'C\'è un pronto soccorso, un telefono per chiamate di soccorso, un centro di soccorso alpino o simili nelle vicinanze della cache. Questo attributo è utile soprattutto in aree difficili, come nel caso di cache con arrampicata, cache in grotte, in alta montagna o nell\'acqua. Controlla se puoi aggiungere un numero di telefono di soccorso (ad esempio del soccorso alpino) nella registrazione della tua cache.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1634', 'IT', 'La geocache è posta vicino ad un\'area di parcheggio, solo poco distante.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1635', 'IT', 'Questa cache richiede una lunga camminata - più di 5 km tra andata e ritorno. In montagna o in altre aree ripide, la distanza per una cache del genere può essere minore. Sono raccomandati scarpe da escursione ed equipaggiamento adeguato.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1636', 'IT', 'Questa cache richiede il superamento di terreno paludoso o acquitrinoso. Indossare un abbigliamento adeguato. Dopo la pioggia, il terreno può essere molto impegnativo o non praticabile a tutti.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1637', 'IT', 'Una o più salite si trovano tra voi e la cache.', '2010-09-12 23:42:33');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1638', 'IT', 'Questa cache richiede un po\' di arrampicata e potrebbe essere necessario usare le mani, ma non c\'è bisogno di attrezzatura da arrampicata. Prestare molta attenzione durante la stagione delle piogge o prima dei temporali!', '2010-09-13 15:06:35');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1639', 'IT', 'Questa cache richiede l\'attraversamento di un fiume o un lago. L\'acqua è abbastanza profonda per nuotare. È possibile utilizzare una barca, ma la distanza è abbastanza breve per essere alla portata di un nuotatore medio.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1640', 'IT', 'C\'è un punto di interesse alla cache, come un bel panorama o di un castello in rovina. Questo luogo merita una visita anche senza una geocache vicina.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1641', 'IT', 'Questa geocache è in muovimento. Per esempio, il proprietario potrebbe spostare regolarmente la cache da un luogo ad un altro, o i cacher potrebbero eseguire questa operazione e indicare nuove coordinate nel loro log. Il proprietario deve aggiornare le coordinate nella descrizione della cache dopo ogni mossa.', '2010-10-27 18:49:19');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1642', 'IT', 'C\'è una webcam nella posizione di destinazione. E\' necessario registrare una foto con la webcam della vostra visita e includerla nel log. Ci possono essere requisiti addizionali come un segnale di geocaching sulla foto. L\'indirizzo della webcam è incluso nella descrizione della cache, e deve essere accessibile al pubblico, cioè non deve essere necessaria una registrazione al sito o simili.', '2010-09-13 15:06:09');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1643', 'IT', 'Questa geocache non è nascosta all\'aria aperta ma all\'interno di un edificio, di una grotta o simili.', '2010-09-12 23:41:36');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1644', 'IT', 'Questa cache o uno dei suoi stadi sono posizionati sott\'acqua. Devi entrare in acqua, nuotare o fare una immersione.', '2010-09-12 23:41:31');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1645', 'IT', 'Questa cache può essere trovata senza un dispositivo GPS. Non sono utilizzate coordinate addizionali oltre alle coordinate iniziali.', '2010-09-12 23:41:26');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1646', 'IT', 'Devi pagare un accesso o parcheggio a pagamento per accedere a questa cache, ad esempio se la cache si trova all\'interno di un parco a tema. Se ci sono alternative di parcheggio gratuiti nelle vicinanze, si prega di includerli nella descrizione. Per favore tieni presenti le nostre condizioni d\'uso a proposito di geocache commerciali.', '2010-09-13 15:05:45');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1647', 'IT', 'Non è possibile trovare questa cache in un solo giorno o una sola notte. Dovrete visitare il percorso per più di una volta, oppure è necessario il pernottamento. Il tempo di preparazione non è incluso in questo calcolo, ma solo il tempo sul sito.', '2010-09-12 23:41:07');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1648', 'IT', 'Una nuova notizia è stata creata su opencaching', '2010-10-27 18:49:19');
