INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1598', 'NL', 'Kindvriendelijk', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1599', 'NL', 'Er zijn spoorlijnen dichtbij. Wees voorzichtig, blijf op veilige afstand van het spoor en steek over op de daarvoor bestemde plaatsen.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1600', 'NL', 'Er zijn rotsen of gevaarlijke rotsen in de buurt. Pas op voor vallende stenen aan de onderkant, en wees voorzichtig aan de bovenzijde van de kliffen (speciaal met kinderen of mountainbikes). ', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1601', 'NL', 'De cache is geplaatst in jachtgebied. In schemering of nacht is een zaklamp of hoofdlamp noodzakelijk voor de veiligheid. Wees er van bewust dan men jagers tegen kan komen.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1602', 'NL', 'In de nabijheid van de cache bevinden zich doornen. Draag beschermende kleding en eventueel handschoenen.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1603', 'NL', 'In bepaald seizoenen komen teken voor in dit gebied. Het wordt aanbevolen lange kleding te dragen en na het cachen de lichamen te controlen op teken.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1604', 'NL', 'In het water', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1605', 'NL', 'Deze cache is de doen bij dag en nacht.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1613', 'NL', 'een kompas is noodzakelijk', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1614', 'NL', 'Een zaklamp is noodzakelijk om deze cache te vinden. Denk ook aan reserve batterijen!', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1615', 'NL', 'Voor deze cache is een klim uitrusting nodig en de benodigde kennis om te klimmen. Indien men geen ervaring heeft is het raadzaam om niet alleen te gaan, maar hulp te vtagen aan iemand met klimervaring.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1616', 'NL', 'Deze cache is geplaatst in een grot, en het is raadzaam om de benodigde zaken mee te nemen. Pas op: Zelfs de klein grotten kunnen gevaren met zich meebrengen zoals bij hevige regenval buiten zou het water de grot in kunnen stromen of men kan gewond raken. Vraag eventueel aan een deskundige om advies. Denk ook aan de natuur, zoals beschermde dieren (vleermuizen) en mogen dan ook niet verstoord worden. ', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1617', 'NL', 'Om deze cache te vinden heeft men een duikuitrusting nodig. Op welke diepte de cache ligt staat beschreven in de beschrijving. Denk er wel aan dat duiken niet zonder ervaring gedaan kan worden, of ga als groep of met een instructeur zoeken.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1618', 'NL', 'Deze cache kan alleen (normaal gesproken)gevonden worden met behulp van een boot. Door de afstand is het niet mogelijk om de cache swemmend te benaderen. Zie de cachebeschrijving voor meer gegevens.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1619', 'NL', 'Voor deze cache moet er informatie opgezocht worden voor het zoeken van de cache. Dit komt vaak voor bij puzzel/mystery caches.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1620', 'NL', 'Bij deze cache moet voor of onderweg een puzzel opgelost worden om de cache te zoeken.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1621', 'NL', 'Er moeten voor of tijdens het cachen rekenopgaven gedaan worden die verder gaan dan het simpele rekenwerk. Bijvoorbeeld middelpuntberekeningen of peilingen.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1642', 'NL', 'Aan het einde is een webcam en om te loggen dient een opname uit die webcam waar men dan op staat te krijgen om te bewijzen dat men daar daadwerkelijk was. Sommige webcam-caches vragen wat extra\'s zoals een banner te tonen. Het webadres dient aangegeven te worden in de beschrijving, en dient vrij toegankelijk te zijn, zonder een account te hoeven maken en vrij van kosten.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1643', 'NL', 'Deze cache in niet geplaatst in open gebied, maar in een gebouw, een grot of iets dergelijks.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1644', 'NL', 'Deze cache of één van de punten is geplaatst onder water. Men dient in het water te gaan, zwemmen of duiken.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1645', 'NL', 'Deze cache kan gevonden worden zonder GPS. Behalve de startcoördinaten heeft men geen andere coördinaten nodig om de cache te zoeken.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1646', 'NL', 'Er dient parkeergeld en/of entree betaald te worden om deze cache te doen, bijvoorbeeld in een themapark. Als er een alternative gratis parkeerplaats in de buurt is dient dat ook in de cachebeschrijving vermeld te worden. Let op onze huidige voorwaarden voor het gebruik met betrekking tot \"commerciële caches\".', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1647', 'NL', 'Deze cache kan niet in één dag of nacht gedaan worden. De locatie zal verschillende keren bezocht moeten worden of moeten overnachten. Voorbereidingstijd is niet berekend, alleen de tijd tijdens het cachen.', '2011-02-04 19:50:08');
INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1648', 'NL', 'Een nieuwsbericht is gemaakt op opencaching', '2011-02-04 19:50:08');
