INSERT INTO `sys_trans_text` (`trans_id`, `lang`, `text`, `last_modified`) VALUES ('1705', 'NL', '<br /><i>Veroudert: Deze attribuut kan bij nieuwe caches niet meer gebruikt worden, omdat het attribuut niet meer aan de actuele  gebruikersvoorwaarden voldoet</i>\r\n<br />Deze cache is niet alleen op opencaching.nl geplaatst, maar ook op andere cachesites. Dit geldt voor caches die door hun eigenaars gekoppeld aan de overeenkomstige vermeldingen op andere sites. Wij wijzen er op, dat ook op opencaching.nl de veranderingen die de cache ondergaat vermeld dienen te worden zoals ook omschreven wordt in de gebruikersverklaring.', '2011-02-04 19:50:08');
